INSERT INTO `matkakohde` (`idmatkakohde`, `kohdenimi`, `maa`, `paikkakunta`, `kuvausteksti`, `kuva`) VALUES (7,'Väinölänniemi','Suomi','Kuopio','Väinölänniemi, tuttavallisemmin Vänäri, on puisto- ja urheilualue aivan Kuopion keskustan tuntumassa. Kallaveden ympäröimä Väinölänniemi on Kuopion vanhimpia ja tunnetuimpia kaupunkipuistoja, ja se toimii merkittävänä virkistys- sekä tapahtumapaikkana niin paikallisille kuin matkailijoillekin.',''),(8,'Vapauden patsas','Yhdysvallat','New York','Vapaudenpatsas (engl. Statue of Liberty), varsinaiselta nimeltään Vapaus valaisee maailmaa (engl. Liberty Enlightening the World, ransk. La liberté éclairant le monde), on suuri naishahmoa esittävä patsas New Yorkin edustalla Liberty Islandin saarella. Patsas on Ranskan kansan lahja Yhdysvalloille juhlistamaan Yhdysvaltain itsenäisyysjulistuksesta 1776 alkanutta maiden välistä ystävyyssuhdetta. Monumenttia ehdotti ranskalainen Édouard de Laboulaye vuonna 1865, ja hän ja kuvanveistäjä Frédéric Auguste Bartholdi yhdessä suunnittelivat patsaan. Ranskalaiset tekivät itse patsaan kuparista, raudasta ja teräksestä ja vastasivat sen kokoamisesta Yhdysvalloissa, ja yhdysvaltalaiset tekivät jalustan. Vapaudenpatsas paljastettiin 28. lokakuuta 1886.',''),(9,'Ibizan yöelämä','Espanja','Ibiza','Välimerellä sijaitseva Ibiza kuuluu Baleaarien saariryhmään yhdessä Mallorcan, Menorcan ja Formenteran kanssa. Reilun 100 000 asukkaan saari rauhoittuu talvella hiljaiseksi espanjalaiskohteeksi, mutta herää kesäisin eloon matkailijoiden vallatessa sen rannat, hotellit ja lukuisat klubit.\n\nJo 1960-luvulla taiteilijat ja kukkaislapset saapuivat nauttimaan saaren lumovoimasta – sama hippihenki on havaittavissa vielä tänäkin päivänä.',''),(10,'Macchu Picchu','Peru','Aguas Calientes','Machu Picchu (ketšuaksi Machu Pikchu, [ˈmatʃʊ ˈpɪktʃʊ], ’vanha vuori’ tai ’vanha huippu’) on muinainen inkakaupunki Andien harjanteella Perussa Etelä-Amerikassa. Kaupunki sijaitsee 2 430 metrin korkeudessa Urubambajoen laaksossa lähellä Inkavaltakunnan pääkaupunki Cuscoa. Kaupungissa oli noin 200 rakennusta, kuten temppeleitä, hallitsijanpalatsi, asuintaloja ja varastoja. Vuorenrinteille oli rakennettu viljelypengermiä. Kaupungissa asui noin 750 asukasta.\n\nInkat aloittivat Machu Picchun rakentamisen noin vuonna 1420. He hylkäsivät kaupungin 1530-luvulla hävittyään espanjalaisvalloittajille. Machu Picchu on Unescon maailmanperintökohde.',''),(11,'Kheopsin pyramidi','Egypti','Giza','Kheopsin pyramidi (myös Khufun pyramidi tai Suuri pyramidi) on suurin ja tunnetuin Gizan egyptiläisistä pyramideista. Neljännen dynastian faarao Kheops (Khufu) oletettavasti rakennutti pyramidin hautapaikakseen noin 2560 eaa. Se oli maailman korkein rakennus yli 3 800 vuoden ajan. Viimeinen säilynyt maailman 7 ihmeestä. ',''),(34,'Colosseum','Italia','Rooma','Colosseum (ital. il Colosseo) on antiikin Rooman aikainen amfiteatteri Roomassa Italiassa. Colosseum oli koko Rooman valtakunnan suurin amfiteatteri, ja sinne mahtui ilmeisesti yli 50 000 katsojaa.\n\nColosseumin rakentamisen aloitti keisari Vespasianus 70-luvun alussa, ja se vihittiin käyttöön vuonna 80 Tituksen hallituskaudella. Colosseumilla järjestettiin sen ensimmäisten vuosisatojen aikana gladiaattoritaisteluita, metsästysnäytöksiä ja muita näytöksiä sekä teloituksia.\n\nNykyisin Colosseum on osittain raunioitunut maanjäristyksien ja kiviaineksen ryöstön takia.[1] Se on Rooman suosituimpia nähtävyyksiä ja katolisen kirkon pyhä paikka.',''),(35,'Niiralan Monttu','Suomi','Kuopio','KalPan pelejä ynnä muuta kivaa.',''),(37,'Rialton silta','Italia','Venetsia','Rialton silta (ital. Ponte di Rialto) on yksi Canal Granden ylittävistä silloista Venetsiassa, Italiassa. Se kuuluu Italian tunnetuimpiin nähtävyyksiin.[1]\n\nNykyisen sillan tilalla oli aluksi ponttonisilta ja myöhemmin puusilta. 1400-luvulla käytettiin nostosiltaa, jotta purjelaivat mahtuisivat kulkemaan kanavassa. Nykyinen Antonio da Ponten suunnittelema kivisilta valmistui vuonna 1591.[1][2]\n\nRialton silta oli aina vuoteen 1854 asti ainoa silta suuren kanaalin yli sekä ainoa kanaalin rantojen yhdistäjä. Tämä Antonio da Ponten luomus alueen lukuisine ostoskatuineen yhdistää juuri Pyhän Markuksen torin ja Rialton alueen toisiinsa.',''),(42,'Stark\'s Pond','Yhdysvallat','South Park','Jossakin melkokeskellä ameriikkaa.',''),(96,'Kuopion Kauppahalli','Suomi','Kuopio','Rakennuksen on suunnitellut Johan Victor Strömberg. Kauppahalli aloitti toimintansa elokuussa 1902. Hallia laajennettiin 1914 Arne Sireliuksen suunnittelemalla lihatarkastamolla, joka toimii nykyään kalahallina. Myöhemmin hallin ulkoasua on paranneltu ja tehty sisäremontteja. Kauppahallin purkamisesta keskusteltiin vakavasti viimeksi 1960-luvulla. Kauppahalli päätettiin kuitenkin kunnostaa 1970-luvun alussa. Rakennuksen nykyinen väritys on peräisin tältä ajalta.',''),(101,'Linnanmäki','Suomi','Helsinki','Enim asperiores perferendis quis? Repudiandae impedit cumque rem \ntenetur ducimus iste nobis dolores aperiam molestiae, modi, voluptatibus enim placeat nam atque autem?\nLorem ipsum dolor sit amet consectetur adipisicing elit. Quisquam sed tenetur nulla nam, laudantium, atque temporibus quibusdam\n ullam sequi voluptatem molestiae distinctio amet quod veniam, possimus similique in molestias ducimus.',''),(102,'Havaji','Yhdysvallat','Honolulu','Enim asperiores perferendis quis? Repudiandae impedit cumque rem \ntenetur ducimus iste nobis dolores aperiam molestiae, modi, voluptatibus enim placeat nam atque autem?\nLorem ipsum dolor sit amet consectetur adipisicing elit. Quisquam sed tenetur nulla nam, laudantium, atque temporibus quibusdam\n ullam sequi voluptatem molestiae distinctio amet quod veniam, possimus similique in molestias ducimus.',''),(103,'Pyhän Pietarin Kappeli','Vatikaani','Vatikaani','Enim asperiores perferendis quis? Repudiandae impedit cumque rem \ntenetur ducimus iste nobis dolores aperiam molestiae, modi, voluptatibus enim placeat nam atque autem?\nLorem ipsum dolor sit amet 